import { StyleSheet } from "react-native";

const StylePassCentre = StyleSheet.create({
        switchOn:{
            display:'flex',
            width:'90%',
            marginLeft:'5%',
            backgroundColor:'#DAB671',
            borderWidth:1,
            
        }
});

export default StylePassCentre;
